css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #4e4e4e;
  padding: 6px;
  border-bottom: 1px solid #2e2e2e;
}
.github-Accordion-header::-webkit-details-marker {
  color: #4e4e4e;
}
.github-Accordion-content {
  border-bottom: 1px solid #2e2e2e;
  background-color: #1a1a1a;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #4e4e4e;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #ffffff;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 3px;
  border-bottom: 1px solid #2e2e2e;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #2e2e2e;
}
